import './App.css';

function App() {
  let langage="REACT";
  return(
    <div className='App'>
      <header className='App-Header'></header>
      <img src="html.png" className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload. 
      </p>
      <a 
        className="App-link" 
        href="https://reactjs.org" 
        target="_blank" 
        rel="noopener noreferrer" 
      >
        Learn {langage} 
          <br/> 
        {2*5} 
      </a>
    </div>
  );
}
export default App;
